import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { NuevaCategoriaComponent } from './categorias/nueva-categoria/nueva-categoria.component';
import { ListaCategoriasComponent } from './categorias/lista-categorias/lista-categorias.component';
import { NuevoProveedorComponent } from './proveedores/nuevo-proveedor/nuevo-proveedor.component';
import { ListaProveedoresComponent } from './proveedores/lista-proveedores/lista-proveedores.component';
import { NuevoUsuarioComponent } from './usuarios/nuevo-usuario/nuevo-usuario.component';
import { NuevoClienteComponent } from './clientes/nuevo-cliente/nuevo-cliente.component';
import { ListaClientesComponent } from './clientes/lista-clientes/lista-clientes.component';
import { ListaUsuariosComponent } from './usuarios/lista-usuarios/lista-usuarios.component';
import { AdministracionRoutingModule } from './administracionRouting.module';
import  {CajasModule} from './cajas/CajasModule'


@NgModule({
  declarations: [
    NuevaCategoriaComponent,
    ListaCategoriasComponent,
    NuevoProveedorComponent,
    ListaProveedoresComponent,
    NuevoUsuarioComponent,
    NuevoClienteComponent,
    ListaClientesComponent,
    ListaUsuariosComponent
  ],
  imports: [
    CommonModule,
    AdministracionRoutingModule,
    CajasModule
  ]
})
export class AdministracionModule { }
